import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Form from './Form';
import UrlBody, { IUrl } from './Downloads'
import axios from "axios";
import { API_URL } from '.';


class App extends Component {

  state = {
    url: "",
    respone_url: [],
  };

  handleSubmit = (urlPassed: string) => {
    this.setState({ url: urlPassed });
    axios.post(API_URL, { 'url': urlPassed }).then((res) => {
      this.setState({ respone_url: res.data });
    });
  }

  render() {
    return (
      <div className="App">
        <Form handleSubmit={this.handleSubmit} />
        <UrlBody urls={this.state.respone_url} />
        {/* <p>{this.state.url}</p> */}
      </div>
    )
  }
}

export default App;
